CREATE TABLE readmissions
	(year INT,
    county VARCHAR(255),
    total_admits INT,
    30_day_readmits INT,
    30_day_readmission_rate DECIMAL(5,2),
    PRIMARY KEY (year, county));

CREATE TABLE elections
	(year INT,
    county VARCHAR(255),
    dem INT,
    dem___ DECIMAL(3,1),
    rep INT,
    rep___ DECIMAL(3,2),
    win CHAR(5)
    PRIMARY KEY (year, county),
    FOREIGN KEY (year, county) REFERENCES readmissions(year, county));

